          <h2>Why Choose PushNotify API?</h2>
          <div className="feature-grid">
            <div className="feature">
              <h3>üîí Secure</h3>
              <p>Industry-standard encryption ensures safe authentication.</p>
            </div>
            <div className="feature">
              <h3>‚ö° Fast</h3>
              <p>Generate JWT tokens instantly with a single request.</p>
            </div>
            <div className="feature">
              <h3>üì° IoT Ready</h3>
              <p>Optimized for IoT devices requiring lightweight authentication.</p>
            </div>
            <div className="feature">
              <h3>üí∞ Affordable</h3>
              <p>Start for free or unlock full access for just ‚Çπ100 one-time.</p>
            </div>
          </div>
        </section>

        {/* How It Works */}
        <section className="how-it-works">
          <h2>How It Works</h2>
          <div className="steps">
            <div className="step">
              <div className="step-icon">üîë</div>
              <h3>Get Access Token</h3>
              <p>Sign up and obtain your secure access token.</p>
            </div>
            <div className="step">
              <div className="step-icon">üõ†Ô∏è</div>
              <h3>Generate JWT Token</h3>
              <p>Use the API to generate a signed JWT token.</p>
            </div>
            <div className="step">
              <div className="step-icon">üöÄ</div>
              <h3>Send Push Notification</h3>
              <p>Save the token and send push notifications instantly.</p>
            </div>
          </div>
        </section>

        {/* Pricing */}
        <section className="pricing">
          <h2>Pricing Plans</h2>
          <div className="pricing-container">
            <div className="price-card">
              <h3>üÜì Free Plan</h3>
              <p>Get started with basic JWT token generation.</p>
              <strong>‚Çπ0</strong>
              <ul>
                <li>‚úÖ Test JWT Tokens</li>
                <li>üö´ No push notifications</li>
