              </ul>
              <a href="/payment?amt=100" className="btn">Upgrade Now</a>
            </div>
          </div>
        </section>

        {/* Call to Action */}
        <section className="cta">
          <h2>üöÄ Start Using PushNotify API Today!</h2>
          <p>Secure, fast, easy JWT token generation and Push Notification for your IoT projects.</p>
          <a href="/api/documentation" className="btn">Read API Docs</a>
        </section>
      </div>

    </>
  );
};

export default Home;
